// AddCar.js
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './AddCar.css';

function AddCar() {
    const [modelo, setModelo] = useState('');
    const [marca, setMarca] = useState('');
    const [ano, setAno] = useState('');
    const [categoria, setCategoria] = useState('');
    const [disponibilidade, setDisponibilidade] = useState(true);
    const [image, setImage] = useState('');
    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();

        const newCar = { modelo, marca, ano, categoria, disponibilidade, image };

        fetch('http://localhost:25000/data', {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(newCar),
        })
        .then(response => response.json())
        .then(data => {
            alert('Carro adicionado com sucesso!');
            navigate('/'); // Volta para a página principal
        })
        .catch(error => console.error("Erro ao adicionar o carro:", error));
    };

    return (
        <div className="add-car-container">
            <h2>Adicionar Novo Carro</h2>
            <form onSubmit={handleSubmit}>
                <label>
                    Modelo:
                    <input
                        type="text"
                        value={modelo}
                        onChange={(e) => setModelo(e.target.value)}
                        required
                    />
                </label>
                <label>
                    Marca:
                    <input
                        type="text"
                        value={marca}
                        onChange={(e) => setMarca(e.target.value)}
                        required
                    />
                </label>
                <label>
                    Ano:
                    <input
                        type="number"
                        value={ano}
                        onChange={(e) => setAno(e.target.value)}
                        required
                    />
                </label>
                <label>
                    Categoria:
                    <input
                        type="text"
                        value={categoria}
                        onChange={(e) => setCategoria(e.target.value)}
                        required
                    />
                </label>
                <label>
                    Disponibilidade:
                    <select
                        value={disponibilidade}
                        onChange={(e) => setDisponibilidade(e.target.value === 'true')}
                    >
                        <option value="true">Disponível</option>
                        <option value="false">Indisponível</option>
                    </select>
                </label>
                <label>
                    Foto URL:
                    <input
                        type="text"
                        value={image}
                        onChange={(e) => setImage(e.target.value)}
                    />
                </label>
                <button type="submit">Adicionar Carro</button>
            </form>
        </div>
    );
}

export default AddCar;
